import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { DatosPService } from '../../services/datos-pservice.service';
import { DatosPModel } from '../../models/datosPModel';

@Component({
  selector: 'app-pais',
  templateUrl: './pais.component.html',
  styleUrls: ['./pais.component.css']
})
export class PaisComponent implements OnInit {
  datosPaises: DatosPModel[] = [];
  paisForm: FormGroup;

  constructor(private paisService: DatosPService, private fb: FormBuilder) {
    this.paisForm = this.fb.group({
      _id: [''],
      nombre: ['', Validators.required]
    });
  }

  ngOnInit() {
    this.cargarDatosP();
  }

  cargarDatosP() {
    this.paisService.getDatosP().subscribe(
      data => {
        this.datosPaises = data;
      },
      error => {
        console.error('Error al cargar datos de países:', error);
      }
    );
  }

  agregarPais() {
    if (this.paisForm.valid) {
      this.paisService.addDatosP(this.paisForm.value).subscribe(
        () => {
          this.cargarDatosP();
          this.paisForm.reset();
        },
        error => {
          console.error('Error al agregar país:', error);
        }
      );
    }
  }

  actualizarPais() {
    if (this.paisForm.valid) {
      this.paisService.updateDatosP(this.paisForm.value).subscribe(
        () => {
          this.cargarDatosP();
          this.paisForm.reset();
        },
        error => {
          console.error('Error al actualizar país:', error);
        }
      );
    }
  }

  eliminarPais(id: string) {
    this.paisService.deleteDatosP(id).subscribe(
      () => {
        this.datosPaises = this.datosPaises.filter(pais => pais._id !== id);
      },
      error => {
        console.error('Error al eliminar país:', error);
      }
    );
  }

  editarPais(pais: DatosPModel) {
    this.paisForm.patchValue(pais);
  }
}
<nav class="navbar navbar-expand-lg navbar-dark bg-dark">
  <div class="container-fluid">
    <a class="navbar-brand" href="#">RentAuto</a>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav"
      aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarNav">
      <ul class="navbar-nav">
        <li class="nav-item">
          <a class="nav-link active" aria-current="page" href="#">Home</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">autos</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">Lugar</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">Pais</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="/ciudad">Ciudad</a>
        </li>
      </ul>
    </div>
  </div>
</nav>

<div class="container">
  <br>
  <div class="row">
    <!-- Parte Izquierda - Formulario -->
    <div class="col-md-4">
      <div class="card">
        <div class="card-body">
          <h5 class="card-title">Agregar/Editar País</h5>
          <form [formGroup]="paisForm">
            <div class="form-group">
              <label for="country-name">Nombre del País:</label>
              <input type="text" class="form-control" id="country-name" name="nombre" formControlName="nombre" required>
            </div>
            <div class="btn-group mt-2">
              <button type="button" class="btn btn-primary" (click)="agregarPais()">Agregar</button>
              <button type="button" class="btn btn-success ms-2" (click)="actualizarPais()">Actualizar</button>
            </div>
          </form>
          
        </div>
      </div>
    </div>

    <!-- Parte Derecha - Tabla -->
    <div class="col-md-8">
      <table class="card-body">
        
        <thead>
            <th scope="col">#</th>
            <th scope="col"></th>
            
        </thead>
        <tbody id="country-table-body">
          <tr *ngFor="let pais of datosPaises; let i = index">
            <th scope="row">{{ i + 1 }}</th>
            <td>{{ pais.nombre }}</td>
            <td>
              <button class="btn btn-sm btn-primary" (click)="editarPais(pais)">Editar</button>
              <button class="btn btn-sm btn-danger ms-2" (click)="eliminarPais(pais?._id ?? '')">Eliminar</button>
            </td>
          </tr>
        </tbody>
      </table>
    </div>
  </div>
</div>

